function dataUsers() {
    const url = 'https://jsonplaceholder.typicode.com/users';
    useEffect(() => {
        axios.get(url)
            .then(response => response)
            .then(data => {
                setUsers(data.data);
                console.log(data.data)
            }).catch(error => console.error(error))
    }, [])
}



  return (
    <ContextUsers.Provider value={users}>
